import React from 'react'
import { Navigate, useNavigate } from 'react-router-dom';
import '../App.css'

const LogOut = () => {
 const navigate = useNavigate()
 const Log_Out=()=>{
  console.log("Clear");
  localStorage.clear();
  navigate("/l");
 }
  return (
    <div>
     <div className='button'>
      <p className='btn btn-link' onClick = {() => Log_Out()}> Log Out </p>
     </div>
    </div>
  )
}

export default LogOut
